import React from 'react';

import '../components/scss/LogIn.scss'


export const LoginPage = () => {

    const BtnClck = () => {
        let signUpForm = document.querySelector('.signup-form')
        let signWr = document.querySelector('.signup-wrap')
        signUpForm.classList.add('signup-form__active')
        signWr.setAttribute('style', 'display: none')
    }

    return (
        <>
            <div className="signup-wrap">
                <h2 className="page-title">Sign Up</h2>
                <h3 className="page-subtitle">Already a member? <a href="/login">Log In</a></h3>
                <button className="btn-form" onClick={BtnClck()}>Sign up with email</button>
            </div>
            <form className="signup-form">
                <input type="email" name="email"/>
                <input type="password"/>
                <button type="submit" className="btn-signup">Sign up</button>
            </form>

            
             
        </>
    )
}
